import React from 'react';
import { BrowserRouter, Switch, Route } from "react-router-dom";
import Home from "./pages/home"

export function App() {
  return (
    <BrowserRouter>
        <Switch>
            <Route path="/signin">
                <p>I will be the sign in page</p>
            </Route>
            <Route path="/signup">
                <p>I will be the sign up page</p>
            </Route>
            <Route path="/browse">
                <p>I will be the browse page</p>
            </Route>
            <Route path="/">
                <Home />
            </Route>
        </Switch>
    </BrowserRouter>
  );
}
